import React, { Component } from "react";
import Slider from "react-slick";

export default class CertificationSlider extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1
    };
    return (
      <div>
        <Slider {...settings}>
        <div className="certification-main-container"><div className="certification-container"></div></div>
        </Slider>
      </div>
    );
  }
}
